import './App.scss';
import React from "react";
import Header from "./Components/Header/Header";
import {BrowserRouter} from "react-router-dom";
import {Route, Switch} from "react-router";
import Patient from "./Components/Main Content/Patient/Patient";
import PatientInformationWrapper from "./Components/Main Content/Patient/Patient Information/PatientInformationWrapper";
import {
    clinicsURLs as clinicsURL,
    employeeURLS,
    invoicesURL,
    patientURLS,
    waitingQueueURLs
} from "./Constants/URLConstants";
import Employee from "./Components/Main Content/Employee/Employee";
import InvoiceInfo from "./Components/Main Content/Invoices/InvoiceInfo";
import WaitingQueueForm from "./Components/Main Content/Waiting Queue/WaitingQueueForm";
import Clinic from "./Components/Main Content/Clinics Components/Clinic";
import ClinicForm from "./Components/Main Content/Clinics Components/ClinicForm";
import ClinicsTable from "./Components/Main Content/Clinics Components/ClinicsTable";

function App() {
    // const whyDidYouRender = require('@welldone-software/why-did-you-render');
    // whyDidYouRender(React, {
    //     trackAllPureComponents: true,
    // });

    return (
        <div className="application">
            <BrowserRouter>
                <Header/>
                <main className="main-content">
                    <Switch>

                        {/*patient routes*/}
                        <Route exact path={patientURLS.patient} component={Patient}/>
                        <Route exact path={`${patientURLS.patientInfo}/:id`} component={PatientInformationWrapper}/>

                        {/*employee routes*/}
                        <Route exact path={employeeURLS.employee} component={Employee}/>

                        {/*invoice routers*/}
                        <Route exact path={invoicesURL.getInvoice+`/:id`} component={InvoiceInfo}/>


                        {/*waiting queue routers*/}
                        <Route exact path={waitingQueueURLs.waitingQueueForm } component={WaitingQueueForm}/>

                        {/*clinics routers*/}
                        <Route exact path={clinicsURL.clinics} component={ClinicsTable}/>
                        <Route exact path={clinicsURL.clinics+`/:id`} component={Clinic}/>


                    </Switch>
                </main>

            </BrowserRouter>

        </div>
    );
}

export default App;
